import * as React from 'react';
import { createTheme, ThemeProvider } from '@mui/material/styles';
import { purple } from '@mui/material/colors';
import Button from '@mui/material/Button';
import { padding } from '@mui/system';

const theme = createTheme({
  typography: {
    button: {
      textTransform: "none",
      backgroundColor: '#f3f6f4',
    },
    "font-family": '"Source Sans Pro", sans-serif',
    "fontSize": 15,
    "fontWeightLight": 100,
    "fontWeightRegular": 200,
    "fontWeightMedium": 300
   },
  palette: {
    primary: {
      // Purple and green play nicely together.
      main: '#000000',
    },
    secondary: {
      // This is green.A700 as hex.
      main: '#000000',
    },
  },
});

function Palette({childrem}) {
  return (
    <div class="head">
      <ThemeProvider theme={theme} spacing={2}>
        <Button padding='5px' size="large"><b>home</b></Button>
        <Button size="large"><b>about</b></Button>
        <Button size="large" ><b>achivements</b></Button>
        <Button size="large" ><b>publications</b></Button>
      </ThemeProvider>
    </div>
  );
}

export default Palette
